import './style.css'

import { Component } from 'react';

export class Button extends Component {
    render(){
        const {text, onClick, page, postPerPage, allPosts} = this.props
        const noMorePosts = page + postPerPage >= allPosts.lenght

        return (
                <button className="button" onClick={onClick} disabled={noMorePosts}>
                        {text}
                </button>
        )
            }
}
